SELECT MIN(title.id), MIN(link_type.link), MIN(movie_info.movie_id), MIN(title.kind_id), MIN(aka_title.movie_id), MIN(kind_type.id), MIN(movie_keyword.movie_id), MIN(title.title) FROM title, movie_keyword, kind_type, link_type, aka_title, movie_info WHERE link_type.link != 'unknown link' AND title.title IN ('(#1.9)', '(#1.1)', '(#1.5)', '(#2.127)', 'Eine Allerweltsgeschichte', '(#1.3)', '(#1.10)', '(#1.2)', '(#1.6)', 'A Visita da Velha Senhora', 'El Señor Presidente', 'Star Power', 'Song 25', '(#1.7)', 'The Boardroom', 'Zweedse rapsodie', '51º edición de los premios Ondas', '(#1.4)', '(#1.8)', 'Shipshape-Less') AND kind_type.id = title.kind_id AND title.id = aka_title.movie_id AND movie_info.movie_id = title.id AND title.id = movie_keyword.movie_id;